import Axios from "axios";
import React, { useState } from "react";
import { Link, resolvePath } from "react-router-dom";

export default function Login() {
    const [email, setName] = useState("");
    const [password, setPassword] = useState("");

    const auth = (username, password) => {
        Axios.post("http://localhost:3001/auth", {
            name: username,
            password: password,
        }).then((response) => {
            if(response.data == "ok"){
                console.log("logat in client");
            }
            else{
                console.log("nelogat in client");
            }
        }).catch((error) => {
            console.log(error)
        });
    };

      
    const handleLogin = () => {
        const credentials = {
        email: email,
        password: password
        };
    
        Axios.get('http://localhost:3001/auth', credentials, {withCredentials: true})
        .then(response => {
            if (response.status === 200) {
            console.log('Autentificare reușită!');
            window.location.replace("http://localhost:3000")
            // Executați acțiuni corespunzătoare pentru autentificarea reușită
            } else {
            console.log('Autentificare eșuată!');
            // Executați acțiuni corespunzătoare pentru autentificarea eșuată
            }
        })
        .catch(error => {
            console.error('Eroare:', error);
        });
    };
      



    return (
        <div className="loginDiv">
            <div className="formLogin">
                <h4>Login</h4>
                <form>
                    <div className="input-container">
                        <label>Username </label>
                        <input
                            type="text"
                            name="uname"
                            onChange={(e) => setName(e.target.value)}
                            required
                        />
                    </div>
                    <div className="input-container">
                        <label>Password </label>
                        <input
                            type="password"
                            name="pass"
                            onChange={(e) => setPassword(e.target.value)}
                            required
                        />
                    </div>
                    <div className="button-container">
                        <input type="submit" onClick={handleLogin}/>
                    </div>
                </form>
            </div>
        </div>
    );
}
